    "2016-04-19T02:28:55.436762",nt"name": "2003-transportation-curb-to-curb-planimetrics",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset was developed to define the
    locations of transportation polygons (e.g. pavement cover) as of the spring of 2003.
    The City of Austin through the Capital Area Council of Governments (CAPCOG) contracted
    Sanborn Mapping, Inc. to update the City of Austin's planimetric database. The planimetrics
    were created from imagery acquired in Spring 2003 using photogrammetric techniques.
    This product is for informational purposes and may not have been prepared for or
    be suitable for legal, engineering, or surveying purposes. It does not represent
    an on-the-ground survey and represents only the approximate relative location of
    property boundaries. This product has been produced by the Communications and Technology
